Everyone’s schedule will be different. Moral of the story “not having time” to workout is an excuse ✊🏻

@xross_talk Appreciate the perspective. 

No doubt, balance, recovery, and sustainability matter. But for a lot of people, “I don’t have time” is just an excuse. The reality is, if something is truly a priority, you make the time… whether that means waking up earlier, cutting back on distractions, or restructuring your day. 

Small sacrifices lead to big results. 💪

